const App: React.FC = () => {
  return (
    <div>
      <h1>Personal Finance Budgeting App</h1>
      <BudgetOverview />
      <CategorySpending />
      <SetupBudget />
      <TransactionEntry />
    </div>
  );
};

export default App;
